window.bookSummaryJSON = "<p><b><i>A spinoff of the Cat &amp; Mouse Duet...</i></b><br> <br> <i>“Molly Devereaux has been missing for more than two weeks, and police are still searching for the girl who seemed to vanish out of thin air. The world still wants to know... Where's Molly?”</i><br> <br> In my dreams, I never escaped the Oregon woods.<br> <br> Life after death isn't easy to accept, especially when I still feel like a ghost.<br> <br> Now, I live deep in the mountains of Montana—the paradigm of beauty. But they are also the home of horrors.<br> <br> Horrors that I only unleash at night.<br> <br> When my pigs are allowed to feast. <br> <br> <b><i>It is strongly recommended to listen to Haunting Adeline and Hunting Adeline before Where's Molly.</i></b></p> <p><b><i>Important Note: This is a dark romance that contains dark subject matter. Please refer to the author's website for content warnings.</i></b></p>"; 
